"use strict";(self.webpackChunkwos_wiki=self.webpackChunkwos_wiki||[]).push([[7008],{4474:e=>{e.exports=JSON.parse('{"tag":{"label":"Resources","permalink":"/Pilot.lua-Luau-LSP/docs/tags/resources","allTagsPath":"/Pilot.lua-Luau-LSP/docs/tags","count":42,"items":[{"id":"Objects/AlienCore","title":"AlienCore","description":"A mysterious piece of technology found within many robotic aliens.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/AlienCore"},{"id":"Objects/Aluminum","title":"Aluminum","description":"A light material useful for air transport. Isn\'t very durable.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Aluminum"},{"id":"Objects/Beryllium","title":"Beryllium","description":"A lightweight metal only found on Barren planets used for preventing plutonium cores from going supercritical until detonated.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Beryllium"},{"id":"Objects/Coal","title":"Coal","description":"A natural resource found abundant in mountains, and is commonly used as a source of generating heat and energy. Can be placed in a BurnerGenerator to generate energy.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Coal"},{"id":"Objects/Copper","title":"Copper","description":"A brown shiny metal, the forefather of electronics.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Copper"},{"id":"Objects/DarkMatter","title":"DarkMatter","description":"A very valuable material extracted from black holes and a few empty regions in space.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/DarkMatter"},{"id":"Objects/Diamond","title":"Diamond","description":"Methods","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Diamond"},{"id":"Objects/ExoticMatter","title":"ExoticMatter","description":"???","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/ExoticMatter"},{"id":"Objects/Flint","title":"Flint","description":"Useful for lighting up flammable materials.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Flint"},{"id":"Objects/Gasoline","title":"Gasoline","description":"A liquid used for fueling many devices such as rockets and engines.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Gasoline"},{"id":"Objects/Glass","title":"Glass","description":"Created when sand is burned or set on fire. Can be broken by heavy impacts or by fist.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Glass"},{"id":"Objects/Gold","title":"Gold","description":"A very valuable and stretchable material.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Gold"},{"id":"Objects/Grass","title":"Grass","description":"An organic substance found in terra and forest planets. Often green, but can be other colors. Useful for planting seeds for agriculture.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Grass"},{"id":"Objects/Helium","title":"Helium","description":"A light invisible odorless gas, floats up.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Helium"},{"id":"Objects/Hydrogen","title":"Hydrogen","description":"A gas commonly found in stars and gas giants.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Hydrogen"},{"id":"Objects/Ice","title":"Ice","description":"A compact natural resource found in tundra planets and the top of a few mountains. It is a slippery material, and has very low friction which can be useful in some devices. Burning ice results in water.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Ice"},{"id":"Objects/Iron","title":"Iron","description":"A compact and durable material, commonly found in planets. It is used often in crafting, and is a very important resource to have.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Iron"},{"id":"Objects/Jade","title":"Jade","description":"Methods","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Jade"},{"id":"Objects/Lava","title":"Lava","description":"A liquid used for fueling many devices such as rockets and engines.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Lava"},{"id":"Objects/Lead","title":"Lead","description":"An uncommon material used in protection against radiation and weapon manufacturing.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Lead"},{"id":"Objects/Magnesium","title":"Magnesium","description":"A shiny gray solid that is flammable, randomly ignites when touching stone.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Magnesium"},{"id":"Objects/Neutronium","title":"Neutronium","description":"The most durable obtainable material in the game. It is a strange form of matter found from the crusts of neutron stars. Due to the nature of neutron stars, neutronium is the hardest known material as well as the densest known material in the universe.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Neutronium"},{"id":"Objects/NitrogenOxide","title":"NitrogenOxide","description":"A light gas emitted from machines such as extractors and rockets. Inhaling can cause severe lung damage.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/NitrogenOxide"},{"id":"Objects/NuclearWaste","title":"NuclearWaste","description":"A highly radioactive material produced from spent Uranium in a reactor.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/NuclearWaste"},{"id":"Objects/Oil","title":"Oil","description":"A liquid used in refineries to produce Gasoline which can be used for fueling engines and rockets and Petroleum which can be used to make plastic.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Oil"},{"id":"Objects/Perfectium","title":"Perfectium","description":"The perfect material. Unbreakable, very stretchable, but is impossibly rare. The very sight of it makes you wonder the imperfections of human beings.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Perfectium"},{"id":"Objects/Petroleum","title":"Petroleum","description":"A gas used for creating plastic.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Petroleum"},{"id":"Objects/Plasma","title":"Plasma","description":"A gas found abundant in stars, and can be harvested from them. Used primarily for weapons, as well as electrical components.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Plasma"},{"id":"Objects/Quartz","title":"Quartz","description":"A translucent and malleable crystal useful for making durable windows.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Quartz"},{"id":"Objects/Ruby","title":"Ruby","description":"Methods","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Ruby"},{"id":"Objects/RustedMetal","title":"RustedMetal","description":"A weathered piece of metal.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/RustedMetal"},{"id":"Objects/Sand","title":"Sand","description":"An abundant resource that can be found in the shores of terra and forest planets, the sea floors of ocean planets and in the dunes of desert planets. When burnt, the sand becomes glass.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Sand"},{"id":"Objects/Silicon","title":"Silicon","description":"A metalloid that is very useful for electronics. Can commonly be found in cliffs and rocks","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Silicon"},{"id":"Objects/Snow","title":"Snow","description":"An abundant resource that can be found in terra biomes and tundra planets. When burnt, the snow turns into water.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Snow"},{"id":"Objects/Steam","title":"Steam","description":"A result of water being heated up to high temperatures.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Steam"},{"id":"Objects/Stick","title":"Stick","description":"A natural resource found in trees and flora, often accompanied by wood. It is used for creating vital tools.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Stick"},{"id":"Objects/Stone","title":"Stone","description":"A resource found in nearly all planets. It is not recommended to use for structures, but is often used in crafting simple objects.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Stone"},{"id":"Objects/Sulfur","title":"Sulfur","description":"A yellow flammable solid. Being set on fire gives it a special blue fire.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Sulfur"},{"id":"Objects/Titanium","title":"Titanium","description":"A strong heavy material that is very useful for small scale constructs.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Titanium"},{"id":"Objects/Uranium","title":"Uranium","description":"A radioactive material often found in deposits in planets, especially ones near stars.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Uranium"},{"id":"Objects/Water","title":"Water","description":"The basis of all life, and is a liquid found in terra, forest, ocean and certain tundras and rogue planets. Can be made from burning ice or snow.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Water"},{"id":"Objects/Wood","title":"Wood","description":"A natural resource found in trees and flora. It is a simple and yet effective material that is used for simple objects and structures. These can be mainly found in terra and forest planets, but can occasionally be found in temperate tundra and desert planets.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Wood"}],"unlisted":false}}')}}]);